import React, { useState } from 'react';
import axios from 'axios';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    otp: '',
  });
  const [step, setStep] = useState(1); // 1: login, 2: MFA
  const [message, setMessage] = useState(null);
  const [error, setError] = useState(null);
  const [tempToken, setTempToken] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleLogin = async e => {
    e.preventDefault();
    setMessage(null);
    setError(null);
    setLoading(true);
    try {
      // Fetch CSRF token first
      const csrfRes = await axios.get('/api/csrf-token');
      const csrfToken = csrfRes.data.csrfToken;

      const res = await axios.post('/api/auth/login', 
        { email: formData.email, password: formData.password },
        { headers: { 'X-CSRF-Token': csrfToken } }
      );
      if (res.data.mfaRequired) {
        setStep(2);
        setTempToken(res.data.userId);
        setMessage('Mã OTP đã được gửi đến email của bạn. Vui lòng nhập mã.');
      } else {
        localStorage.setItem('token', res.data.accessToken);
        localStorage.setItem('refreshToken', res.data.refreshToken);
        window.location.href = '/dashboard';
      }
    } catch (err) {
      setError(err.response?.data?.error || 'Đăng nhập thất bại');
    } finally {
      setLoading(false);
    }
  };

  const handleMFA = async e => {
    e.preventDefault();
    setMessage(null);
    setError(null);
    setLoading(true);
    try {
      // Fetch CSRF token first
      const csrfRes = await axios.get('/api/csrf-token');
      const csrfToken = csrfRes.data.csrfToken;

      const res = await axios.post('/api/auth/login/mfa', 
        { userId: tempToken, otp: formData.otp },
        { headers: { 'X-CSRF-Token': csrfToken } }
      );
      localStorage.setItem('token', res.data.accessToken);
      localStorage.setItem('refreshToken', res.data.refreshToken);
      window.location.href = '/dashboard';
    } catch (err) {
      setError(err.response?.data?.error || 'Xác thực OTP thất bại');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-container">
      <h2>Đăng nhập</h2>
      {message && <div className="alert alert-success">{message}</div>}
      {error && <div className="alert alert-error">{error}</div>}
      {loading && <div className="loading">Đang xử lý...</div>}
      {step === 1 ? (
        <form onSubmit={handleLogin} className="form">
          <div className="form-group">
            <label>Email:</label>
            <input name="email" type="email" value={formData.email} onChange={handleChange} required placeholder="Nhập email" />
          </div>
          <div className="form-group">
            <label>Mật khẩu:</label>
            <input name="password" type="password" value={formData.password} onChange={handleChange} required placeholder="Nhập mật khẩu" />
          </div>
          <button type="submit" className="btn btn-primary" disabled={loading}>Đăng nhập</button>
        </form>
      ) : (
        <form onSubmit={handleMFA} className="form">
          <div className="form-group">
            <label>Mã OTP:</label>
            <input name="otp" value={formData.otp} onChange={handleChange} required placeholder="Nhập mã OTP" />
          </div>
          <button type="submit" className="btn btn-primary" disabled={loading}>Xác thực</button>
        </form>
      )}
    </div>
  );
};
